  \"2016-07-27T23:03:47.511812\",\n\t\"name\": \"1984-annual-project-report-for-fishery-management-program-at-hillside-national-wildlife-re\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Hillside NWR was visited by John S. Forester,
  fishery management biologist, September 11-14, 1984.  The purpose of the trip was
  to sample the one acre borrow ponds along the west levee of the refuge. Of the 78
  borrow ponds, 46 are managed due to historically low susceptibility to flooding
  from nearby Black Creek.  However, in the winter/spring of 1983, flooding of the
  ponds occurred. As a result buffalo and carp have re-invaded the series of ponds.
  \ Sampling was accomplished with rotenone.  Ponds 46 and 66 were totally poisoned.\",\n\t\"license_title\":
